import React, { Component } from "react";
import { connect } from "react-redux";
import * as actions from "./../../../Actions";

class index extends Component {
  componentDidMount() {
    this.props.getUsersAdmin();
    this.props.getUsersCustomer();
  }

  render() {
    var { usersAdmin, usersCustomer } = this.props;
    console.log(usersAdmin);
    console.log(usersCustomer);
    return (
      <div className="container-fluid mt-5" id="manager-users">
        <div className="container">
          <div className="row">
            <div className="col-12 text-center">
              <h3 className="font-ubun">Manager Users</h3>
            </div>
            <div className="col-12">
              <table className="table">
                <thead>
                  <tr>
                    <th>STT</th>
                    <th>Account</th>
                    <th>Password</th>
                    <th>Status</th>
                    <th>Role</th>
                    <th>Actions</th>
                  </tr>
                </thead>
                <tbody></tbody>
              </table>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

const mapStateToProps = (state) => {
  return {
    usersAdmin: state.usersAdmin,
    usersCustomer: state.users,
  };
};

const mapDispatchToProps = (dispatch, props) => {
  return {
    getUsersAdmin: () => {
      return dispatch(actions.acGetUserAdminRequest());
    },
    getUsersCustomer: () => {
      return dispatch(actions.acGetUsersRequest());
    },
  };
};

export default connect(mapStateToProps, mapDispatchToProps)(index);
